import axios from 'axios';
require('dotenv').config();

const API = axios.create({
    baseURL: `https://pixabay.com/api/?key=${process.env.PIXABAY_API_KEY}`,
    header: { 
       'Accept': 'application/json',
       'Content-type': 'application/json' 
    }
})

export default API;
